import { Component } from '@angular/core';
import { Marca } from '../models/marca.model';

@Component({
  selector: 'gc-marca-edit',
  templateUrl: './marca-edit.component.html',
  styleUrls: ['./marca-edit.component.css'],
})
export class MarcaEditComponent {
  public id?: number;
  marca?: Marca;
  cursoForm!: FormGroup;
  updated = false;
  modalidades = [
    { modalidade: Modalidade.PRESENCIAL, descricao: 'Presencial' },
    { modalidade: Modalidade.EAD, descricao: 'Ensino a Distância' },
    { modalidade: Modalidade.HIBRIDO, descricao: 'Semi presencial' },
  ];
}
